import React from "react";
import "./sidebar.css";

const Backdrop = ({ sidebar, closeSidebar }) => {
  return (
    <div
      className={sidebar ? "backdrop backdrop--open" : "backdrop"}
      onClick={closeSidebar}
    ></div>
  );
};

export default Backdrop;
